import React, { Component } from "react";
import './Count.css'
import PropTypes from 'prop-types'

class Count extends Component{
    constructor(){
        super();
    }
    
    render(){
        return(
            <div>
            <button type="button" className="btn btn-warning" onClick={() => this.props.onCountClickCallback(this.props.by)}></button>
            </div>
        );
    }
}

Count.defaultProps = {
    by: 1
}

export default Count
